import React from "react";
import "./App.css";
import Content from "./Content/Content";
import Header from "./Header/Header";
import { extendTheme } from "@chakra-ui/react"

const theme = extendTheme({
  colors: {
    brand: {
      100: "#191308",
      200: "#322A26",
      300: "#454B66",
      400: "#677DB7",
      500: "#9CA3DB"
    },
  },
})

function App() {
  return (
    <div className="App">
      <Header />
      <Content />
    </div>
  );
}

export default App;
